// src/components/ExcelImportTest.js - ENHANCED VERSION
import React, { useState } from 'react';
import { Upload, FileText, Users, AlertCircle, CheckCircle, Info } from 'lucide-react';
import { parseExcelFile, validateStudentData } from '../utils/excelParser';

const ExcelImportTest = () => {
    const [parseResult, setParseResult] = useState(null);
    const [isLoading, setIsLoading] = useState(false);
    const [dragActive, setDragActive] = useState(false);

    const handleFileUpload = async (file) => {
        if (!file) return;

        console.log('ðŸ“ Starting file upload:', file.name, 'Type:', file.type, 'Size:', file.size);
        setIsLoading(true);
        setParseResult(null);

        try {
            // Check file type
            const fileName = file.name.toLowerCase();
            const isOldExcel = fileName.endsWith('.xls');
            const isNewExcel = fileName.endsWith('.xlsx');

            if (!isOldExcel && !isNewExcel) {
                throw new Error('Please upload a valid Excel file (.xls or .xlsx)');
            }

            if (isOldExcel) {
                console.log('ðŸ“‹ Detected old Excel format (.xls) - using enhanced parsing');
            }

            const result = await parseExcelFile(file);
            console.log('ðŸ“Š Parse result:', result);

            if (result.success && result.students.length > 0) {
                const validation = validateStudentData(result.students);
                setParseResult({
                    ...result,
                    validation
                });
            } else {
                setParseResult(result);
            }
        } catch (error) {
            console.error('âŒ Upload error:', error);

            // Enhanced error handling with suggestions
            let errorMessage = error.message;
            let suggestions = [];

            if (error.message.includes('corrupted') || error.message.includes('password-protected')) {
                suggestions.push('Try saving the file as a new .xlsx file in Excel');
                suggestions.push('Ensure the file is not password-protected');
                suggestions.push('Check that the file is not corrupted');
            }

            if (error.message.includes('no data') || error.message.includes('empty')) {
                suggestions.push('Verify the Excel file contains student data');
                suggestions.push('Check that data is in the first worksheet');
                suggestions.push('Ensure there are no empty rows at the beginning');
            }

            setParseResult({
                success: false,
                error: errorMessage,
                suggestions,
                students: [],
                metadata: {
                    fileName: file.name,
                    fileSize: file.size,
                    fileType: file.type,
                    error: errorMessage
                }
            });
        }

        setIsLoading(false);
    };

    const handleDrag = (e) => {
        e.preventDefault();
        e.stopPropagation();
        if (e.type === 'dragenter' || e.type === 'dragover') {
            setDragActive(true);
        } else if (e.type === 'dragleave') {
            setDragActive(false);
        }
    };

    const handleDrop = (e) => {
        e.preventDefault();
        e.stopPropagation();
        setDragActive(false);

        const files = e.dataTransfer.files;
        if (files && files[0]) {
            handleFileUpload(files[0]);
        }
    };

    const handleFileInputChange = (e) => {
        const files = e.target.files;
        if (files && files[0]) {
            handleFileUpload(files[0]);
        }
    };

    const getStatusIcon = (success) => {
        if (success) {
            return <CheckCircle className="text-green-600" size={20} />;
        } else {
            return <AlertCircle className="text-red-600" size={20} />;
        }
    };

    return (
        <div className="max-w-6xl mx-auto p-6 space-y-6">
            {/* Header */}
            <div className="bg-white rounded-lg shadow-md p-6">
                <h2 className="text-2xl font-bold text-gray-800 mb-2">
                    ðŸ“‹ Excel Class List Import Test
                </h2>
                <p className="text-gray-600">
                    Upload an institutional Excel file to test student data extraction and column detection.
                </p>
            </div>

            {/* File Upload Area */}
            <div className="bg-white rounded-lg shadow-md p-6">
                <h3 className="text-lg font-semibold text-gray-800 mb-4">Upload Excel File</h3>

                {/* Troubleshooting Notice */}
                <div className="bg-blue-50 border border-blue-200 rounded-lg p-4 mb-4">
                    <h4 className="font-medium text-blue-800 mb-2">ðŸ“‹ Excel File Requirements</h4>
                    <div className="text-sm text-blue-700 space-y-1">
                        <p>â€¢ File must contain columns for: <strong>ID</strong>, <strong>Name</strong>, and <strong>Email</strong></p>
                        <p>â€¢ Headers should be in the first few rows</p>
                        <p>â€¢ Common header names: "ID", "Student ID", "Name", "Student Name", "Email", "Student Email"</p>
                        <p>â€¢ For .xls files: Consider saving as .xlsx for better compatibility</p>
                    </div>
                </div>

                <div
                    className={`relative border-2 border-dashed rounded-lg p-8 text-center transition-colors ${dragActive
                            ? 'border-blue-500 bg-blue-50'
                            : 'border-gray-300 hover:border-gray-400'
                        }`}
                    onDragEnter={handleDrag}
                    onDragLeave={handleDrag}
                    onDragOver={handleDrag}
                    onDrop={handleDrop}
                >
                    <div className="space-y-4">
                        <div className="flex justify-center">
                            <Upload size={48} className={dragActive ? 'text-blue-500' : 'text-gray-400'} />
                        </div>

                        <div>
                            <p className="text-lg font-medium text-gray-700">
                                {dragActive ? 'Drop Excel file here' : 'Drag and drop Excel file here'}
                            </p>
                            <p className="text-sm text-gray-500 mt-1">
                                Supports .xls and .xlsx files
                            </p>
                        </div>

                        <div className="flex justify-center">
                            <label className="bg-blue-600 text-white px-6 py-2 rounded-lg cursor-pointer hover:bg-blue-700 transition-colors">
                                <span>Choose File</span>
                                <input
                                    type="file"
                                    accept=".xlsx,.xls"
                                    onChange={handleFileInputChange}
                                    className="hidden"
                                />
                            </label>
                        </div>
                    </div>

                    {isLoading && (
                        <div className="absolute inset-0 bg-white bg-opacity-75 flex items-center justify-center rounded-lg">
                            <div className="flex items-center space-x-3">
                                <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-blue-600"></div>
                                <span className="text-gray-700 font-medium">Processing Excel file...</span>
                            </div>
                        </div>
                    )}
                </div>
            </div>

            {/* Results */}
            {parseResult && (
                <div className="space-y-6">
                    {/* Status Summary */}
                    <div className="bg-white rounded-lg shadow-md p-6">
                        <div className="flex items-center space-x-3 mb-4">
                            {getStatusIcon(parseResult.success)}
                            <h3 className="text-lg font-semibold text-gray-800">
                                {parseResult.success ? 'Import Successful' : 'Import Failed'}
                            </h3>
                        </div>

                        {parseResult.error && (
                            <div className="bg-red-50 border border-red-200 rounded-lg p-4 mb-4">
                                <div className="flex items-start space-x-3">
                                    <AlertCircle className="text-red-600 mt-0.5" size={20} />
                                    <div className="flex-1">
                                        <h4 className="font-medium text-red-800">Error Details:</h4>
                                        <p className="text-red-700 mt-1">{parseResult.error}</p>

                                        {/* Suggestions */}
                                        {parseResult.suggestions && parseResult.suggestions.length > 0 && (
                                            <div className="mt-3">
                                                <h5 className="font-medium text-red-800 mb-2">ðŸ’¡ Suggestions to fix this:</h5>
                                                <ul className="list-disc list-inside space-y-1 text-red-700 text-sm">
                                                    {parseResult.suggestions.map((suggestion, index) => (
                                                        <li key={index}>{suggestion}</li>
                                                    ))}
                                                </ul>
                                            </div>
                                        )}

                                        {/* .xls specific help */}
                                        {parseResult.metadata?.fileName?.toLowerCase().endsWith('.xls') && (
                                            <div className="mt-3 p-3 bg-yellow-50 border border-yellow-200 rounded">
                                                <h5 className="font-medium text-yellow-800 mb-1">ðŸ“‹ .xls File Detected</h5>
                                                <p className="text-yellow-700 text-sm">
                                                    Old Excel format (.xls) can sometimes cause issues. Try:
                                                </p>
                                                <ul className="list-disc list-inside mt-1 text-yellow-700 text-sm space-y-1">
                                                    <li>Open in Excel and Save As â†’ Excel Workbook (.xlsx)</li>
                                                    <li>Ensure there are no merged cells in the header row</li>
                                                    <li>Check that the file opens correctly in Excel</li>
                                                </ul>
                                            </div>
                                        )}
                                    </div>
                                </div>
                            </div>
                        )}

                        {/* Metadata Display */}
                        {parseResult.metadata && (
                            <div className="bg-gray-50 rounded-lg p-4">
                                <h4 className="font-medium text-gray-800 mb-3">File Analysis</h4>
                                <div className="grid grid-cols-2 md:grid-cols-4 gap-4 text-sm">
                                    <div>
                                        <span className="text-gray-600">File:</span>
                                        <p className="font-medium">{parseResult.metadata.fileName}</p>
                                        {parseResult.metadata.fileSize && (
                                            <p className="text-xs text-gray-500">
                                                {Math.round(parseResult.metadata.fileSize / 1024)} KB
                                            </p>
                                        )}
                                    </div>
                                    <div>
                                        <span className="text-gray-600">File Type:</span>
                                        <p className="font-medium">
                                            {parseResult.metadata.fileName?.toLowerCase().endsWith('.xls') ?
                                                'Excel 97-2003 (.xls)' :
                                                parseResult.metadata.fileName?.toLowerCase().endsWith('.xlsx') ?
                                                    'Excel 2007+ (.xlsx)' :
                                                    'Unknown'
                                            }
                                        </p>
                                    </div>
                                    <div>
                                        <span className="text-gray-600">Total Rows:</span>
                                        <p className="font-medium">{parseResult.metadata.totalRows || 0}</p>
                                    </div>
                                    <div>
                                        <span className="text-gray-600">Data Rows:</span>
                                        <p className="font-medium">{parseResult.metadata.dataRows || 0}</p>
                                    </div>
                                    <div>
                                        <span className="text-gray-600">Students Found:</span>
                                        <p className="font-medium text-blue-600">{parseResult.metadata.studentsFound || 0}</p>
                                    </div>
                                    <div>
                                        <span className="text-gray-600">Columns Detected:</span>
                                        <p className="font-medium">{parseResult.metadata.columnsDetected || 0}</p>
                                    </div>
                                </div>

                                {/* Headers Display */}
                                {parseResult.metadata.headers && (
                                    <div className="mt-4">
                                        <h5 className="font-medium text-gray-800 mb-2">Detected Headers:</h5>
                                        <div className="bg-white rounded border p-3">
                                            <div className="flex flex-wrap gap-2">
                                                {parseResult.metadata.headers.map((header, index) => (
                                                    <span
                                                        key={index}
                                                        className="bg-gray-100 text-gray-700 px-2 py-1 rounded text-xs font-mono"
                                                    >
                                                        {index}: "{header}"
                                                    </span>
                                                ))}
                                            </div>
                                        </div>
                                    </div>
                                )}

                                {/* Column Mapping Display */}
                                {parseResult.metadata.columnMapping && (
                                    <div className="mt-4">
                                        <h5 className="font-medium text-gray-800 mb-2">Column Mapping:</h5>
                                        <div className="bg-white rounded border p-3">
                                            {Object.keys(parseResult.metadata.columnMapping).length > 0 ? (
                                                <div className="grid grid-cols-2 md:grid-cols-4 gap-3">
                                                    {Object.entries(parseResult.metadata.columnMapping).map(([type, index]) => (
                                                        <div key={type} className="bg-blue-50 rounded p-2">
                                                            <div className="text-xs text-blue-600 font-medium uppercase">{type}</div>
                                                            <div className="text-sm font-mono">
                                                                Col {index}: "{parseResult.metadata.headers[index]}"
                                                            </div>
                                                        </div>
                                                    ))}
                                                </div>
                                            ) : (
                                                <div className="text-red-600 text-sm">
                                                    âŒ No columns detected - this is likely the source of the problem
                                                </div>
                                            )}
                                        </div>
                                    </div>
                                )}
                            </div>
                        )}
                    </div>

                    {/* Course Information */}
                    {parseResult.courseInfo && Object.keys(parseResult.courseInfo).length > 0 && (
                        <div className="bg-white rounded-lg shadow-md p-6">
                            <h3 className="text-lg font-semibold text-gray-800 mb-4 flex items-center">
                                <Info className="mr-2" size={20} />
                                Course Information Extracted
                            </h3>
                            <div className="grid grid-cols-2 md:grid-cols-4 gap-4">
                                {Object.entries(parseResult.courseInfo).map(([key, value]) => (
                                    <div key={key}>
                                        <span className="text-gray-600 capitalize">{key}:</span>
                                        <p className="font-medium">{value}</p>
                                    </div>
                                ))}
                            </div>
                        </div>
                    )}

                    {/* Student Data Display */}
                    {parseResult.students && parseResult.students.length > 0 && (
                        <div className="bg-white rounded-lg shadow-md p-6">
                            <h3 className="text-lg font-semibold text-gray-800 mb-4 flex items-center">
                                <Users className="mr-2" size={20} />
                                Student Data ({parseResult.students.length} students)
                            </h3>

                            {/* Validation Summary */}
                            {parseResult.validation && (
                                <div className="mb-4 p-4 bg-gray-50 rounded-lg">
                                    <h4 className="font-medium text-gray-800 mb-2">Validation Summary</h4>
                                    <div className="grid grid-cols-3 gap-4 text-sm">
                                        <div>
                                            <span className="text-green-600">âœ… Valid:</span>
                                            <span className="font-medium ml-2">{parseResult.validation.summary.valid}</span>
                                        </div>
                                        <div>
                                            <span className="text-red-600">âŒ Invalid:</span>
                                            <span className="font-medium ml-2">{parseResult.validation.summary.invalid}</span>
                                        </div>
                                        <div>
                                            <span className="text-blue-600">ðŸ“Š Completeness:</span>
                                            <span className="font-medium ml-2">
                                                {Math.round(parseResult.validation.summary.completeness * 100)}%
                                            </span>
                                        </div>
                                    </div>
                                </div>
                            )}

                            {/* Student Table */}
                            <div className="overflow-x-auto">
                                <table className="w-full border-collapse border border-gray-300">
                                    <thead>
                                        <tr className="bg-gray-100">
                                            <th className="border border-gray-300 px-4 py-2 text-left">Row</th>
                                            <th className="border border-gray-300 px-4 py-2 text-left">ID</th>
                                            <th className="border border-gray-300 px-4 py-2 text-left">Name</th>
                                            <th className="border border-gray-300 px-4 py-2 text-left">Email</th>
                                            <th className="border border-gray-300 px-4 py-2 text-left">Program</th>
                                            <th className="border border-gray-300 px-4 py-2 text-left">Level</th>
                                            <th className="border border-gray-300 px-4 py-2 text-left">Status</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {parseResult.students.slice(0, 20).map((student, index) => (
                                            <tr key={index} className="hover:bg-gray-50">
                                                <td className="border border-gray-300 px-4 py-2 text-sm">
                                                    {student.originalRow}
                                                </td>
                                                <td className="border border-gray-300 px-4 py-2 font-mono text-sm">
                                                    {student.id || 'â€”'}
                                                </td>
                                                <td className="border border-gray-300 px-4 py-2 font-medium">
                                                    {student.name || 'â€”'}
                                                </td>
                                                <td className="border border-gray-300 px-4 py-2 text-sm">
                                                    {student.email || 'â€”'}
                                                </td>
                                                <td className="border border-gray-300 px-4 py-2 text-sm">
                                                    {student.program || 'â€”'}
                                                </td>
                                                <td className="border border-gray-300 px-4 py-2 text-sm">
                                                    {student.level || 'â€”'}
                                                </td>
                                                <td className="border border-gray-300 px-4 py-2 text-sm">
                                                    {student.status || 'â€”'}
                                                </td>
                                            </tr>
                                        ))}
                                    </tbody>
                                </table>

                                {parseResult.students.length > 20 && (
                                    <p className="text-sm text-gray-600 mt-2">
                                        Showing first 20 of {parseResult.students.length} students
                                    </p>
                                )}
                            </div>
                        </div>
                    )}

                    {/* Debug Information */}
                    {parseResult.metadata && (
                        <div className="bg-gray-100 rounded-lg p-4">
                            <details>
                                <summary className="cursor-pointer font-medium text-gray-800 mb-2">
                                    ðŸ”§ Debug Information (Click to expand)
                                </summary>
                                <div className="bg-white rounded p-4 mt-2">
                                    <pre className="text-xs text-gray-600 whitespace-pre-wrap overflow-x-auto">
                                        {JSON.stringify(parseResult.metadata, null, 2)}
                                    </pre>
                                </div>
                            </details>
                        </div>
                    )}

                    {/* No Data Found - Troubleshooting Guide */}
                    {parseResult && parseResult.success === false && parseResult.metadata?.totalRows === 0 && (
                        <div className="bg-white rounded-lg shadow-md p-6">
                            <h3 className="text-lg font-semibold text-gray-800 mb-4 flex items-center">
                                <AlertCircle className="mr-2 text-orange-500" size={20} />
                                No Data Found - Troubleshooting Guide
                            </h3>

                            <div className="space-y-4">
                                <div className="bg-yellow-50 border border-yellow-200 rounded-lg p-4">
                                    <h4 className="font-medium text-yellow-800 mb-2">ðŸ”§ Try These Solutions:</h4>
                                    <ol className="list-decimal list-inside space-y-2 text-yellow-700 text-sm">
                                        <li><strong>Check File Format:</strong> Ensure it's a valid .xls or .xlsx Excel file</li>
                                        <li><strong>Convert to .xlsx:</strong> Open in Excel and Save As â†’ Excel Workbook (.xlsx)</li>
                                        <li><strong>Verify Content:</strong> Open the file in Excel to confirm it contains data</li>
                                        <li><strong>Check First Sheet:</strong> Ensure student data is in the first worksheet</li>
                                        <li><strong>Remove Protection:</strong> If password-protected, remove protection before upload</li>
                                        <li><strong>Clear Formatting:</strong> Remove merged cells, especially in header rows</li>
                                    </ol>
                                </div>

                                <div className="bg-blue-50 border border-blue-200 rounded-lg p-4">
                                    <h4 className="font-medium text-blue-800 mb-2">ðŸ“‹ Expected File Structure:</h4>
                                    <div className="bg-white rounded border p-3 font-mono text-sm">
                                        <div className="grid grid-cols-7 gap-2 border-b pb-2 mb-2 font-bold">
                                            <span>Component</span>
                                            <span>ID</span>
                                            <span>Name</span>
                                            <span>Program</span>
                                            <span>Level</span>
                                            <span>Campus</span>
                                            <span>Email</span>
                                        </div>
                                        <div className="grid grid-cols-7 gap-2 text-gray-600">
                                            <span>Studio Session 1</span>
                                            <span>400001</span>
                                            <span>John Doe</span>
                                            <span>ART301</span>
                                            <span>2</span>
                                            <span>Main</span>
                                            <span>john.doe@email.com</span>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    )}
                </div>
            )}
        </div>
    );
};

export default ExcelImportTest;
